import React, { useState} from 'react';

function App({detail}){
		const [name, setname]= useState("Aakash");
		const Say = () => { 
		setname(detail[1]);
		};
		
		return(
		<div>
		<h1>hey {name}</h1>
	
		<button onClick={Say}>reapot</button>
		</div>
		)
		}
export default App;
